import React from 'react'
import { SideBarData } from './SideBarData'

export default function SideBar() {
  return (
    <div className='Sidebar'>
        <ul className='SidebarList'>
        {SideBarData.map((sideBar,key)=>{
            return (
                <li>
                    <div id='icon'>{sideBar.icon}</div>
                </li>
            )
        })}

        </ul>

    </div>
  )
}
